import React, { Component } from 'react';
import './NewList.scss';

class NewList extends Component {
    state = {
        name: ""
    }

    render() {

        return (
            <div className="centered-content">
                <div className="modal-box">
                    <h1 className="title">Create a new list</h1>
                    <input class="input has-background-light is-medium" type="text" placeholder="Enter list name..." />
                    <br></br>
                    <div class="buttons is-right">
                        <button class="button is-medium" routerLink="/">Cancel</button>
                        <button class="button is-primary has-text-white is-medium">Create</button>
                    </div>
                </div>
            </div>
        )
    }
}

export default NewList
